import { Grid } from 'semantic-ui-react';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import Topics from '../component/Topics';

function Member(){
    return (
        <Grid>
            <Grid.Row>
                <Grid.Column width={3}>
                    會員選單
                </Grid.Column>
                <Grid.Column width={10}>
                    <BrowserRouter>
                        <Routes>
                            <Route 
                                path='/my/history'
                                element={<Topics />}
                            ></Route>
                            <Route 
                                path='/my/settings'
                                element={"會員設定"}
                            ></Route>
                        </Routes>
                    </BrowserRouter>
                </Grid.Column>
                <Grid.Column width={3}></Grid.Column>
            </Grid.Row>
        </Grid>
    );
}

export default Member;
